                        <div key={e.id}>
                            <p>{e.name}</p>
                            <p>Weight: {e.weight}</p>
                            <p>Reps: {e.reps}</p>
                            <p>Sets: {e.sets}</p>
                            <button>Delete</button>
                        </div>
                    )
                })}
            </div>
        </div>
    )
}

